        return _get(bitmap._inner, data);
    }

    /**
     * @dev Sets the value at the given uint256 index.
     */
    function set(Uint256TwoBitsMap storage bitmap, uint256 data, uint8 value) internal {
        _set(bitmap._inner, data, value);
    }

